import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";
import { BrowserRouter, Link } from "react-router-dom";

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 60px;
  color: white;
  font-family: "Amatic SC", cursive;
`;

const NewTask = styled.div`
  text-align: center;
`;

const AllTasks = styled.div`
  text-align: center;
`;

const Completed = styled.div`
  display: grid;
  justify-comtent: center;
  text-decoration: none;
`;

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Title>Feladatok</Title>

        <Completed>
          <Button className="Uncompleted" variant="dark">
            <Link to="/uncompleted">Elvégzendő feladatok</Link>
          </Button>
        </Completed>
        <Completed>
          <Button className="Completed" variant="dark">
            <Link to="/completed">Teljesített feladatok</Link>
          </Button>

          <Button className="All" variant="dark">
            <Link to="all">Összes feladat</Link>
          </Button>

          <Button variant="dark">
            <Link to="new">Feladat hozzáadása</Link>
          </Button>
        </Completed>
      </div>
    </BrowserRouter>
  );
}

export default App;
